    protected override Humidifier.DynamoDB.GlobalTableTypes.ReplicaSpecification Create()
    {
        var replicaSpecificationResult = CreateReplicaSpecification();
        factoryAction?.Invoke(replicaSpecificationResult);

        return replicaSpecificationResult;
    }

    private Humidifier.DynamoDB.GlobalTableTypes.ReplicaSpecification CreateReplicaSpecification()
    {
        var replicaSpecificationResult = new Humidifier.DynamoDB.GlobalTableTypes.ReplicaSpecification();

        return replicaSpecificationResult;
    }
    public override void CreateChildren(Humidifier.DynamoDB.GlobalTableTypes.ReplicaSpecification result)
    {
        base.CreateChildren(result);

        result.SSESpecification ??= SSESpecificationFactory?.Build();
        result.KinesisStreamSpecification ??= KinesisStreamSpecificationFactory?.Build();
        result.ContributorInsightsSpecification ??= ContributorInsightsSpecificationFactory?.Build();
        result.PointInTimeRecoverySpecification ??= PointInTimeRecoverySpecificationFactory?.Build();
        result.ReplicaStreamSpecification ??= ReplicaStreamSpecificationFactory?.Build();
        result.ResourcePolicy ??= ResourcePolicyFactory?.Build();
        result.ReadProvisionedThroughputSettings ??= ReadProvisionedThroughputSettingsFactory?.Build();
        result.ReadOnDemandThroughputSettings ??= ReadOnDemandThroughputSettingsFactory?.Build();
    }

